import GitLang from "./GitLang";
import { First } from "react-bootstrap/PageItem";
const LangGenerator: React.SFC = () => {
  const { gitLangFreq, isLoading } = useGitProjectCalculator();

  if (isLoading) {
    return <p>Loading</p>;
  }

  let gitLangs: Array<string> = gitLangFreq && Object.keys(gitLangFreq);
  let gitCalc = gitLangs && { gitLangs, gitLangFreq };
  console.log(gitCalc);

  const GitLangPrinter = (obj, obj2) => {
    console.log(obj2.length);
    for (var i = 0; i < obj2.length; i++) {
      console.log(i);
      return <GitLang key={i} language={obj2[i]} ammount={obj[i]} />;
    }
  };

  return (
    <React.Fragment>
      {gitLangFreq && GitLangPrinter(gitLangFreq, gitLangs)}
    </React.Fragment>
  );
};

export default LangGenerator;
